/*
Clase que representa a una entidad con imagen. Extiende de la clase Entity
 */
function Stage(src, x, y, z, w, h, etapa, paint)
{
   // Constructor de la clase padre
   Entity.call(this, x, y, w, h, z);

   this.image = new Image();
   this.image.src = src;
   this.etapa = etapa;
   this.paint = paint;

   this.draw = function (context)
   {
      if (!this.paint){
		return;
	  }
	  
      for (yAxis = 0; yAxis < 65; yAxis ++ )
      {
         for (xAxis = 0; xAxis < 90; xAxis ++ )
         {
            if ( this.etapa[yAxis][xAxis] == 2)
            {
               var x = xAxis * 10 - PLANO.x;
               var y = yAxis * 10 - PLANO.y;
               context.drawImage(this.image, x, y, 10, 10);
            }
         }
      }
   }

   this.collision = function(entity)
   {

      if (entity.busy)
      {
         return false;
      }

      if (entity instanceof Character)
      {

		 //console.log(entity.x +"," +entity.y +"," + entity.xInS +"," + entity.yInS + "," +entity.typeCollision);
         var colIni = Math.floor(entity.xInS / 10);
         var rowIni = Math.floor(entity.yInS / 10);
         var colFin = Math.floor((entity.xInS + entity.w) / 10);
         var rowFin = Math.floor((entity.yInS + entity.h) / 10);
		 
		 if (colIni == 34){
			var hola =1;
		 }
         for (yAxis = rowIni; yAxis <= rowFin; yAxis ++ )
         {
            for (xAxis = colIni; xAxis <= colFin; xAxis ++ )
            {
			   if ((yAxis >= 0 && yAxis < this.etapa.length) && (xAxis >= 0 && xAxis < this.etapa[yAxis].length)){
				if ( this.etapa[yAxis][xAxis] == 2)
				{
                  entity.typeCollision = 2;
                  return true;
				}
               // Pasos a otros escenarios
				if ( this.etapa[yAxis][xAxis] >= 100 && this.etapa[yAxis][xAxis] <= 200)
				{
				  entity.typeCollision = 3;
                  entity.idNearStage = this.etapa[yAxis][xAxis];
				  return true;
				}
			   }
            }
         }
      } else if (entity instanceof Shoot){
		 var x = entity.x+PLANO.x;
		 var y = entity.y+PLANO.y;
		 var colIni = Math.floor(x / 10);
         var rowIni = Math.floor(y / 10);
         var colFin = Math.floor((x + entity.r) / 10);
         var rowFin = Math.floor((y + entity.r) / 10);
		 
         for (yAxis = rowIni; yAxis <= rowFin; yAxis ++ )
         {
            for (xAxis = colIni; xAxis <= colFin; xAxis ++ )
            {
			   if ((yAxis >= 0 && yAxis < this.etapa.length) && (xAxis >= 0 && xAxis < this.etapa[yAxis].length)){
					if (this.etapa[yAxis][xAxis] == 2 || (this.etapa[yAxis][xAxis] >= 100 && this.etapa[yAxis][xAxis] <= 200)){
						return true;
					}
			   }
            }
         }
	  }
      return false;
   }

}
